import Card from '@material-ui/core/Card';
import CardHeader from '@material-ui/core/CardHeader';
import CardMedia from '@material-ui/core/CardMedia';
import CardContent from '@material-ui/core/CardContent';
import { Grid } from '@material-ui/core';
import ArrowRightAltIcon from '@material-ui/icons/ArrowRightAlt';
import "./ResultsPage.css";


function Quote(props) {

    return <div>

        <Card className="quoteCard">
            <CardHeader title={props.MinPrice} className="quoteCardHeader">

            </CardHeader>
            <CardContent>

                <Grid container spacing={2} alignItems="center">

                    <Grid item style={{ flexGrow: 1 }}>
                        <p> {props.airline} </p>
                    </Grid>
                    <Grid item style={{ flexGrow: 1 }}>
                        <p> {props.isDirect} </p>
                    </Grid>
                    <Grid item style={{ flexGrow: 1 }}>
                        <p className="airportText"> Baltimore Washington International (BWI)</p>
                        <p><ArrowRightAltIcon /></p>
                        <p className="airportText"> Washington Ronald Reagan (DCA) </p>
                    </Grid>

                </Grid>
            </CardContent>
        </Card>

    </div>;

}

export default Quote;
